    value: The following details are provided in regards to the letter of March 18
      2003 about this report. Each contribution noted in the letter as a potential
      excessive contribution was not an excessive contribution
  - value: ' but was incorrectly entered by us.  Each contribution was for $1000.  Each
      occured during the period directly before our Primary election when we were
      required to file 48 hour notices.  The 48 hour notices were filed correctly
      and in a timely fashion.  Unfortunately'
  - value: ' when we went to submit the July Quarterly report'
  - value: ' we mistakenly re-entered each of these checks as a duplicate contribution.  In
      other words'
  - value: ' each of these contributions was entered twice - once on the 48 hour notice
      and once on the regular report.  We apparently were unaware at the time that
      the FECFile software kept track of the 48 hour notices and included the appropriate
      contributions in the next appropriate regulary scheduled report.  This occured
      with the ten contributors you referenced as well as one additional one (Kurt
      Larson - who was entered once as Kurt Larson and once as Kurt Larsen - same
      contribution).  All eleven of these instances were $1000 contributions only.  The
      duplicate contribution entries have been deleted.  This correction also answers
      the concern that there may have been required 48 hour notices that weren''t
      filed.  All required 48 hour notices were filed. Notices were not filed for
      the duplicate entries.'
  expected_count: 4
  input: TEXT,F3A,,"The following details are provided in regards to the letter of
    March 18 2003 about this report. Each contribution noted in the letter as a potential
    excessive contribution was not an excessive contribution, but was incorrectly
    entered by us.  Each contribution was for $1000.  Each occured during the period
    directly before our Primary election when we were required to file 48 hour notices.  The
    48 hour notices were filed correctly and in a timely fashion.  Unfortunately,
    when we went to submit the July Quarterly report, we mistakenly re-entered each
    of these checks as a duplicate contribution.  In other words, each of these contributions
    was entered twice - once on the 48 hour notice and once on the regular report.  We
    apparently were unaware at the time that the FECFile software kept track of the
    48 hour notices and included the appropriate contributions in the next appropriate
    regulary scheduled report.  This occured with the ten contributors you referenced
    as well as one additional one (Kurt Larson - who was entered once as Kurt Larson
    and once as Kurt Larsen - same contribution).  All eleven of these instances were
    $1000 contributions only.  The duplicate contribution entries have been deleted.  This
    correction also answers the concern that there may have been required 48 hour
    notices that weren't filed.  All required 48 hour notices were filed. Notices
    were not filed for the duplicate entries."
